import React, { useState, useEffect } from "react";

const Market = () => {
    const [activeTab, setActiveTab] = useState("shop"); 
    const [shopItems, setShopItems] = useState([]);
    const [tooltipVisible, setTooltipVisible] = useState(false);
    const [tooltipPosition, setTooltipPosition] = useState({ x: 0, y: 0 });
    const [tooltipContent, setTooltipContent] = useState(null);
    const [userItems, setUserItems] = useState([]);
    const [marketItems, setMarketItems] = useState([]);
    const [selectedItem, setSelectedItem] = useState(null);
    const [isSellModalOpen, setIsSellModalOpen] = useState(false);
    const [sellData, setSellData] = useState({ type: "fixed", price: "", duration: "2" });

    const ShopData = async (newShopForMoney = false) => {
        const token = localStorage.getItem("token");
        if (!token) {
            console.warn("Brak tokenu w localStorage");
            return;
        }
        try {
            const response = await fetch(`http://localhost:8080/api/ItemShop?newShopForMoney=${newShopForMoney}`, {
                method: "GET",
                headers: {
                    Authorization: `Bearer ${token}`,
                },
            });
            if (!response.ok) {
                console.error("Błąd pobierania sklepu:", response.statusText);
                return;
            }
            const data = await response.json();
            setShopItems(data.ShopItems);
            setUserItems(data.userItems);
        } catch (error) {
            console.error("Błąd pobierania sklepu:", error);
        }
    };

    useEffect(() => {
        ShopData();
    }, []);

    const fetchMarketItems = async () => {
        const token = localStorage.getItem("token");
        if (!token) {
            console.warn("Brak tokenu w localStorage");
            return;
        }
        try {
            const response = await fetch("http://localhost:8080/api/market/items", {
                method: "GET",
                headers: {
                    Authorization: `Bearer ${token}`,
                },
            });
            if (!response.ok) {
                console.error("Błąd pobierania przedmiotów:", response.statusText);
                return;
            }
            const data = await response.json();
            setMarketItems(data || []);
        } catch (error) {
            console.error("Błąd pobierania przedmiotów:", error);
        }
    };

    useEffect(() => {
        fetchMarketItems();
        fetchUserItems();
    }, []);

    const fetchUserItems = async () => {
        const token = localStorage.getItem("token");
        if (!token) {
            console.warn("Brak tokenu w localStorage");
            return;
        }
        try {
            const response = await fetch("http://localhost:8080/api/user/usersCreaturesAndItemsDate", {
                method: "GET",
                headers: {
                    Authorization: `Bearer ${token}`,
                },
            });
            if (!response.ok) {
                console.error("Błąd pobierania przedmiotów użytkownika:", response.statusText);
                return;
            }
            const data = await response.json();
            setUserItems(data?.userItems || []);
        } catch (error) {
            console.error("Błąd pobierania przedmiotów użytkownika:", error);
        }
    };

    const handleSell = async (type) => {
        const token = localStorage.getItem("token");
        if (!token || !selectedItem) {
            console.warn("Brak tokenu lub nie wybrano przedmiotu");
            return;
        }
        try {
            const response = await fetch("http://localhost:8080/api/market/sell", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json",
                    Authorization: `Bearer ${token}`,
                },
                body: JSON.stringify({
                    ...sellData,
                    itemId: selectedItem._id,
                    type,
                }),
            });
            if (!response.ok) {
                console.error("Błąd wystawiania przedmiotu:", response.statusText);
                return;
            }
            alert("Przedmiot został wystawiony!");
            fetchMarketItems();
            setIsSellModalOpen(false);
        } catch (error) {
            console.error("Błąd wystawiania przedmiotu:", error);
        }
    };

    return (
        <div className="w-full h-full bg-black1 flex justify-center p-5 flex-col space-y-4">
            <div className="flex justify-around w-full p-4 bg-maincolor1 rounded-xl mb-4 shadow-lg sticky top-0 z-10">
                <button onClick={() => setActiveTab("market")} className="text-maincolor4 text-lg hover:text-blue-600 transition-all">
                    Market
                </button>
                <button onClick={() => setActiveTab("inventory")} className="text-maincolor4 text-lg hover:text-blue-600 transition-all">
                    Inventory
                </button>
            </div>
            {activeTab === "market" && (
                <div className="grid grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4 max-h-[60vh]">
                    {marketItems.length === 0 ? (
                        <p className="text-maincolor4 text-center">Brak przedmiotów na markecie.</p>
                    ) : (
                        marketItems.map((item) => (
                            <div key={item._id} className="bg-maincolor1 rounded-xl p-4 shadow-xl">
                                <img src={`/images/${item.item.photo}.png`} alt={item.item.name} className="w-full h-32 object-cover rounded-xl" />
                                <h3 className="text-xl text-maincolor4 mb-2 font-bold">{item.item.name}</h3>
                                <p className="text-maincolor4 text-sm mb-2">{item.item.description}</p>
                                <p className="text-maincolor4 font-bold mt-2">Price: {item.buyoutPrice} coins</p>
                            </div>
                        ))
                    )}
                </div>
            )}
        </div>
    );
};

export default Market;
